import React, { useState } from "react";
import { Switch, Route, useHistory } from "react-router-dom";
import airportpic from "./airport.jpg";

function Airport() {
  const [modalShowing, setModalShowing] = useState(false);
  const history = useHistory();

  function letsgo() {
    //first make them pick mode, then pass mode down as prop ?
    //probably use state (in app probably) as the prop to pass down
    history.push("/travelling");
  }

  function viewPassport() {
    history.push("/passport");
  }

  function editProfile() {
    history.push("/profile");
  }

  return (
    <Switch>
      <Route exact path="/">
        <div
          style={{
            background: `url(${airportpic})`,
            height: "100vh",
            width: "100%",
            backgroundRepeat: "no-repeat",
            backgroundSize: "cover",
          }}
        >
          <div className="content">Welcome {"Bingo Bongo"} !</div>
          <br></br>
          <div className="content" onClick={letsgo}>
            Take a new trip
          </div>
          <br></br>
          <div className="content" onClick={viewPassport}>
            View Passport
          </div>
          <br></br>
          <div className="content" onClick={editProfile}>
            Edit Profile
          </div>
        </div>
      </Route>
    </Switch>
  );
}

export default Airport;
